import axios from 'axios';

const recordings = {
  get: () => {
    return axios
      .get('http://localhost:1337/recordings')
      .then((response) => {
        console.log('rec', response);
      })
      .catch((error) => {
        console.log(error);
      });
  }
};

export default recordings;
